import React from 'react';
import newsletterimg from "../img/mailing-list-img.png";

class Newsletter extends React.Component {
    render() {
        return (
            <section className='newsletter'>
                <div className='container'>
                    <div className='img-newsletter'>
                        <img src={newsletterimg} alt="heroimg" />
                    </div>
                    <div className='text-newsletter'>
                        <div className="box-text-newsletter">
                            <h3>
                                Sign up for our newsletter and get 10% 
                                off your next order.
                            </h3>
                        </div>
                    </div>
                </div>
            </section>
        );
    }
}

export default Newsletter;
